INSERT INTO `article_content` VALUES (4,4,'<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 21px; color: rgb(255, 140, 0);\"><span style=\"font-family: Verdana; font-size: large;\"><strong>WishList</strong></span></span><br style=\"white-space: normal; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); font-size: 12px; line-height: 21px;\"/><br style=\"white-space: normal; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); font-size: 12px; line-height: 21px;\"/><span style=\"font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); font-size: small; line-height: 21px;\">For every product you like on shopofweddingdress.com, you can use the &quot;Add to wish list&quot; function to save it into your own account for your later checking.<br style=\"font-family: Verdana;\"/><br style=\"font-family: Verdana;\"/>To access your account, please log in first and then choose the wish list button to see what products have already been added into your wish list.</span></p>',NULL,NULL,NULL,NULL,''),(3,3,'<p><span style=\"font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); font-size: small; line-height: 21px;\">Shopofweddingdress.com will provide order tracking numbers whenever the order status is changed into &quot;Shipped&quot; status. The shipping company&#39;s tracking number will be posted into every customer&#39;s account page. You will be notified by your registered email with this tracking number. Along with tracking number, customers will enter the shipping company&#39;s official website to check the shipping status of your package.</span><br style=\"white-space: normal; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); font-size: small; line-height: 21px;\"/><br style=\"white-space: normal; font-family: Arial, Helvetica, sans-serif; color: rgb(51, 51, 51); font-size: small; line-height: 21px;\"/><br style=\"white-space: normal; font-family: Arial, Helvetica, s