INSERT INTO `info_content` VALUES (2,2,'<h3 class=\"sectitle\" style=\"margin: 0px; padding: 0px; font-size: 18px; font-weight: normal; height: 32px; line-height: 32px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; white-space: normal;\">How to ask for an invoice?</h3><div class=\"mainbox\" style=\"word-wrap: break-word; margin: 0px 0px 10px; padding: 10px; overflow: hidden; height: 256px; border-top-width: 0px; line-height: 18px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal;\"><br/>*Reminder: DHgate is only a platform provided for buyers and sellers.<br/><br/>Therefore, when requesting for an invoice, buyers shall contact their sellers directly as they are the real providers.<br/><br/><img alt=\"\" src=\"/u_file/1501/images/4c556a8ce7.png\" style=\"border: 0px;\" width=\"741\" height=\"133\"/></div><p><br/></p>','','','','',''),(3,3,'<h3 class=\"sectitle\" style=\"margin: 0px; padding: 0px; font-size: 18px; font-weight: normal; height: 32px; line-height: 32px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; white-space: normal;\">What should I do if the seller provides an invalid tracking number?</h3>\r\n\r\n<div class=\"mainbox\" style=\"word-wrap: break-word; margin: 0px 0px 10px; padding: 10px; overflow: hidden; height: 1966px; border-top-width: 0px; line-height: 18px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal;\">\r\n<div style=\"word-wrap: break-word; margin: 0px; padding: 0px; line-height: 24px;\">\r\n<div align=\"left\" style=\"word-wrap: break-word; margin: 0px; padding: 0px;\">\r\n<div align=\"left\" style=\"word-wrap: break-word; margin: 0px; padding: 0px;\">The seller is responsible to provide a tracking number on your order page after your order is placed and shipped. If no tracking information appears after 5\\7\\10 business days(It depends on your couriers.), you may do the following:</div>\r\n\r\n<div align=\"left\" style=\"word-wrap: break-word; margin: 0px; padding: 0px;\">&nbsp;</div>\r\n\r\n<div style=\"word-wrap: break-word; margin: 0px; padding: 0px;\">Please contact the&nbsp;seller&nbsp;and ask him or her to contact the shipping company to obtain the tracking information; or you may contact the shipping company directly through their official website. If the&nbsp;seller&nbsp;does not respond, you may report this to DHgate as an&nbsp;<strong>invalid tracking number</strong>. We will then&nbsp;confirm whether it is&nbsp;an invalid order.&nbsp;<a href=\"https://www.youtube.com/watch?v=skrVX6DyAMs\" style=\"color: rgb(0, 51, 153); text-decoration: none;\">Click Here</a>&nbsp;to check the video. &nbsp;&nbsp;<br />\r\n&nbsp;</div>\r\n\r\n<div style=\"word-wrap: break-word; margin: 0px; padding: 0px;\">To report an invalid tracking number, you should first sign in to your DHgate account and go to &quot;My DHgate&quot;. From there locate &quot;Active Orders&quot; and select &quot;Shipped&quot;&nbsp;&nbsp;from the drop-down menu. You will then see a list of all your shipped items. Proceed to click &quot;Tracking&quot;, as illustrated below:<br />\r\n<br />\r\n<img alt=\"\" height=\"161\" src=\"http://image.dhgate.com/upload/php/cms/20130924/1380009569.png\" style=\"border: 0px;\" width=\"746\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img alt=\"\" src=\"http://image.dhgate.com/2009/help/1117/arrow.jpg\" style=\"border: 0px;\" /><br />\r\n<img alt=\"\" height=\"278\" src=\"http://image.dhgate.com/upload/editors/ff/e/ffea4e20832da56a61e5709b097951ce0b6e64ef.jpg\" style=\"border: 0px;\" width=\"431\" /><br />\r\n<img alt=\"\" src=\"http://image.dhgate.com/2009/help/1117/arrow.jpg\" style=\"border: 0px;\" /><br />\r\n<img alt=\"\" height=\"268\" src=\"http://image.dhgate.com/upload/editors/58/7/5874ffb408334b4625960c2943301aba7929f1ef.jpg\" style=\"border: 0px;\" width=\"426\" /><br />\r\n&nbsp;\r\n<div align=\"left\" style=\"word-wrap: break-word; margin: 0px; padding: 0px;\">After the buyer reports an invalid tracking number, the tracking status will be shown as &ldquo;Awaiting handling&rdquo;. We&rsquo;ll look into this as soon as possible to determine whether it is an invalid tracking number.<br />\r\n<br />\r\nPlease be advised to go to your &ldquo;Message History&rdquo; to check for updates on our progress after 3 days.<br />\r\n<br />\r\nOnce we have confirmed that the tracking number is invalid, DHgate shall request the seller to provide a correct tracking number with updated information in your Tracking Record. If the seller refuses to do so, then the seller&rsquo;s account will be penalized by DHgate.<br />\r\n<br />\r\n&nbsp;</div>\r\n<img alt=\"\" height=\"220\" src=\"http://image.dhgate.com/upload/editors/9b/7/9b7ad5fb67e00c6a657a97fdc4ba8f014b80a495.jpg\" style=\"border: 0px;\" width=\"691\" /><br />\r\n<br />\r\n<strong>After your report, if we confirm the tracking number is invalid, penalization will be Inflicted on sellers:</strong><br />\r\n<br />\r\nIf the order is part of the Dispatch Pledge program, DHgate will confirm whether the tracking number is invalid or not. If cannot upload a valid tracking number at a specific time, our system will deduct US $30 from the seller&rsquo;s account to compensate the customer.<br />\r\n<br />\r\nIf&nbsp;the order is not part of the Dispatch Pledge program,&nbsp;DHgate will freeze&nbsp;the&nbsp;seller&#39;s account for 7 days.<br />\r\n<br />\r\n<strong>Please note, you cannot click the &quot;Report Invalid Tracking NO.&quot; button in the following situations:</strong><br />\r\n<br />\r\n1. 45 days after items are shipped;<br />\r\n2. After payment is released;<br />\r\n3. The order is in &ldquo;Return and Refund&rdquo; status;<br />\r\n4. The order is closed.</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p>&nbsp;</p>',NULL,NULL,NULL,NULL,''),(4,4,'',NULL,NULL,NULL,NULL,NULL),(6,6,'',NULL,NULL,NULL,NULL,NULL),(9,9,'',NULL,NULL,NULL,NULL,''),(13,13,'',NULL,NULL,NULL,'',NULL),(14,14,'',NULL,NULL,NULL,'',NULL),(15,15,'',NULL,NULL,NULL,'',NULL),(16,16,'',NULL,NULL,NULL,'',NULL),(17,17,'',NULL,NULL,NULL,'',NULL),(18,18,'',NULL,NULL,NULL,'',NULL),(19,19,'<h2 class=\"line_120 border_b pad_bottom\" style=\"margin: 0px; padding: 0px 0px 10px; font-size: 16px; line-height: 19px; font-family: Verdana, Helvetica, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">How do I measure my size?</h2><p><br/></p>',NULL,NULL,NULL,'<h2 class=\"line_120 border_b pad_bottom\" style=\"margin: 0px; padding: 0px 0px 10px; font-size: 16px; line-height: 19px; font-family: Verdana, Helvetica, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">How do I measure my size?</h2><p><br/></p>',NULL),(20,20,'<h1>About Us</h1>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<p><font face=\"Arial\">Establish in Moscow in 1993, is a specialized in the research, development and production of Backpack trolley case, leisure bags and other luggage products. We are located in China with convenient transportation access. &nbsp;All of our products comply with international quality standards and are greatly appreciated in a variety of different markets throughout the world. As a result of our high quality products and outstanding customer service, &nbsp;we have gained a global sales network reaching Russia, Poland, Eastern European countries and the United States. Also cooperating with the e-commerce platforms domestic and abroad. For example, Taobao、Tmall、Jingdong、Amazon、Alibaba、eBay and so on.</font></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><font face=\"Arial\">If you are interested in any of our products or would like to discuss a custom order, please feel free to contact us. We are looking forward to forming successful business relationships with new clients around the world in the near future.</font></p>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><img src=\"http://weixin.fengme.cc/xcwm/image/catalog/yyw/14498179599122709.png\" /><img src=\"http://weixin.fengme.cc/xcwm/image/catalog/yyw/14498179713595487.png\" /><img src=\"http://weixin.fengme.cc/xcwm/image/catalog/yyw/14498179815206083.png\" /></h4>',NULL,NULL,NULL,NULL,NULL),(21,21,'<h1>Contact us</h1>\r\n\r\n<p><font face=\"Arial\">Address: Floor 7, RK building, NO14, shangwuwaihuan Road, Zhengzhou, China</font></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><font face=\"Arial\">Zip <a href=\"Code:450000\">Code:450000</a></font></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><font face=\"Arial\">Phone:&nbsp;（86-371）69102809</font></p>\r\n&nbsp;\r\n\r\n<p><font face=\"Arial\">Web: http://www.xinchigroup.com/</font></p>\r\n\r\n<p>&nbsp;</p>',NULL,NULL,NULL,NULL,NULL);
