INSERT INTO `products_description` VALUES (39,39,'<ul>\r\n	<li><span style=\"font-family:微软雅黑,arial;\"><strong>Three materials to ensure the effect of reducing burden</strong>, the first layer of soft and toughness high EVA composite material, the second layer built in board, the third layer of high quality breathable polyester fabric. Never worry about your book and homework in the backpack get wet</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\"><strong>Ergonomic relieve burden and heat dissipation system</strong>, full-thickness 20mm breathable massage cotton cushion, strong sponge back design provide comfortable carrying experience and prevent from spinal scoliosis, inclined shoulder, hunchback, spinal deformation</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\"><strong>Adjustable widening foam shoulder straps for a personalized fit</strong>, chest strap and waist strap design are beneficial to relieve shoulders burden. In addition, reflective strips on the shoulder straps and bear pattern reflective strips on the side pockets help to ensure children&#39;s safety</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\"><strong>Large capacity</strong> includes 1 main pocket with 3 sandwich compartments for books, 1 attached pocket for stationery or daily use, 2 side pockets for bottle or other personal belongings</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\"><strong>3D silk-screen printing and 3D hot press forming pattern are very special</strong>, the unique look is sure to earn your kid cool points. It&rsquo;s the best-match backpack for your children in school</span></li>\r\n</ul>',NULL,NULL,NULL,NULL,NULL,'Size','Weight','Performance','<span style=\"font-family:微软雅黑,arial;\"><strong>Gender</strong>:Boys<br />\r\n<br />\r\n<strong>Size</strong>:38*30*14cm/15.3*11.8*6.3inch<br />\r\n<br />\r\n<strong>Closure Type</strong>:Zipper<br />\r\n<br />\r\n<strong>Suitable For</strong>:Grade 1~4<br />\r\n<br />\r\n<strong>Main-Color</strong>:Black</span>','<span style=\"font-family:微软雅黑,arial;\">Weight:800g<br />\r\n<br />\r\n<strong>It&#39;s comfortable for your kids to wear and it isn&#39;t affect your child&#39;s spine,so important we think.</strong></span>','<span style=\"font-family:微软雅黑,arial;\"><strong>1.LIGHT</strong><br />\r\nIt&#39;s comfortable for your kids to wear<br />\r\n<br />\r\n<strong>2.COMFORTABLE</strong><br />\r\nYou could clearly see in the picture,the design of shoulder straps and backrest are some lump and bulge,Human Engineering to protect your childen&#39;s spine.<br />\r\n<br />\r\n<strong>3.WATERPROOF</strong><br />\r\nHigh quality material, excellent waterproof performance.<br />\r\n<br />\r\n<strong>4.REFLECTIVE STRIPE</strong><br />\r\nSimilar to traffic lights on the polic body, can protect your child&#39;s life safety.</span><br />\r\n<br />\r\nPlease be aware that due to your computer monitor display the color may have some difference between the picture and the physical item'),(38,38,'<ul>\r\n	<li>Three materials to ensure the effect of reducing burden, the first layer of soft and toughness high EVA composite material, the second layer built in board, the third layer of high quality breathable polyester fabric. Never worry about your book and homework in the backpack get wet</li>\r\n	<li>Ergonomic relieve burden and heat dissipation system, full-thickness 20mm breathable massage cotton cushion, strong sponge back design provide comfortable carrying experience and prevent from spinal scoliosis, inclined shoulder, hunchback, spinal deformation</li>\r\n	<li>Adjustable widening foam shoulder straps for a personalized fit, chest strap and waist strap design are beneficial to relieve shoulders burden. In addition, reflective strips on the shoulder straps and bear pattern reflective strips on the side pockets help to ensure children&#39;s safety</li>\r\n	<li>Large capacity includes 1 main pocket with 3 sandwich compartments for books, 1 attached pocket for stationery or daily use, 2 side pockets for bottle or other personal belongings</li>\r\n	<li>3D silk-screen printing and 3D hot press forming pattern are very special, the unique look is sure to earn your kid cool points. It&rsquo;s the best-match backpack for your children in school</li>\r\n</ul>',NULL,NULL,NULL,NULL,NULL,'Size and Weight','','','Size: 30 x 16 x 36 cm / 11.8 x 6.3 x 14.1 inch<br />\r\nWeight:&nbsp;0.8kg','',''),(37,37,'<ul>\r\n	<li>Three materials to ensure the effect of reducing burden, the first layer of soft and toughness high EVA composite material, the second layer built in board, the third layer of high quality breathable polyester fabric. Never worry about your book and homework in the backpack get wet</li>\r\n	<li>Ergonomic relieve burden and heat dissipation system, full-thickness 20mm breathable massage cotton cushion, strong sponge back design provide comfortable carrying experience and prevent from spinal scoliosis, inclined shoulder, hunchback, spinal deformation</li>\r\n	<li>Adjustable widening foam shoulder straps for a personalized fit, chest strap and waist strap design are beneficial to relieve shoulders burden. In addition, reflective strips on the shoulder straps and bear pattern reflective strips on the side pockets help to ensure children&#39;s safety</li>\r\n	<li>Large capacity includes 1 main pocket with 3 sandwich compartments for books, 1 attached pocket for stationery or daily use, 2 side pockets for bottle or other personal belongings</li>\r\n	<li>3D silk-screen printing and 3D hot press forming pattern are very special, the unique look is sure to earn your kid cool points. It&rsquo;s the best-match backpack for your children in school</li>\r\n</ul>',NULL,NULL,NULL,NULL,NULL,'Size and Weight','','','Size: 30 x 16 x 36 cm / 11.8 x 6.3 x 14.1 inch<br />\r\nWeight:&nbsp;0.8kg','',''),(13,13,'<ul>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">Individual School Backpack - Delune Brand Backpack,Focus on the design and production of children&#39;s schoolbags.Starting in 1993,we have designed a series of backpack unique and durable.As you can see,the style of our backpack you can hardly find in other shops,all of the credit to our designers</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">Orthopedic Kids Backpack - The child&#39;s spine is fragile,and it can easily deform if long weighed.The back of our schoolbag simulate the shape of kid&#39;s spine and to protect kids spine.It&#39;s good for the development of your kids spine</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">Comfortable and safe Boys Backpack - The shoulder strap of a schoolbag has lots of bulge of circular particles,can play the role of massage when on the back of the school bag,it&#39;s very comfortable to children.Besides,we added reflective stripes on the schoolbag, it can reflecting the light at night or in the rain when it was illuminated by the lamp,reminding the driver there is a people.Like the reflector in a traffic police uniform.</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">LightWeight and Waterproof Material - 600*600 High-density Polyester fiber with foam layer,waterproof and durable.Never worry about your book and homework in the backpack get wet,even if you spill a basin of water on your schoolbag.</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">Large-Capacity,Easy to Wash - As you can see on the pictures,our backpack can be disassembled,this design could helps to increase the volume of the bag,and it is also easy to clean.</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\"><b>Features:</b><br />\r\n	Premium material makes it soft, durable, elastic, waterproof, lightweight, dust proof and non-toxic.<br />\r\n	With fashionable style,neat stitching and lightness of weight,it must be a good gift for little kids.<br />\r\n	<b>Life-long service, unconditional refund</b><br />\r\n	<b>Product Details:</b><br />\r\n	Material:600*600 High-density Polyester fiber 