p;','Measurement<br />\r\nMeasurement<br />\r\nMeasurement',''),(69,69,'<ul>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">DELUNE: Based in Eastern European and founded in 1993, Delune committed to making useful, safe and durable backpack for kids</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">QUALITY MATERIAL AND WORKMANSHIP: 600*600 High-density Polyester fiber with foam layer,waterproof and durable. With great workmanship and neat stitching, the backpack with safe zipper closure design is very durable to use.</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">LARGE CAPACITY: This Backpack&#39;s just-right size means your little one can bring the school supplies and an after-school snack. In addition to that, this backpack has a side mesh pocket for easy access to drinks and water bottles.</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">WATERPROOF: Never worry about the book and homework in the backpack get wet,even if you spill a basin of water on the backpack.</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">THE CHOICE OF EUROPEAN PARENTS: The price is a little bit high but &quot;YOU GET WHAT YOU PAY FOR&quot;. We sold a lot in Europe.</span></li>\r\n</ul>',NULL,NULL,NULL,NULL,NULL,'Size and Weight','','','Size: 29*16*38cm/11.4*6.3*14.9inch<br />\r\nWeight: 0.9kg','',''),(70,70,'<span style=\"font-family:微软雅黑,arial;\">A school bag comes from&nbsp;<b>Delune</b>&nbsp;that I am introducing to you which made of 1280D high-density precise water-proof nylon fabric and embroidery. Sturdy, durable and anti-wrinkle. Ergonomic design to make the feeling with less pressure &amp; burden. Widening thickened strap increase the massage drums, reduce shoulder friction damage, avoid high and low shoulder slow the bag and shoulder direct force minus the weight.&nbsp;<br />\r\n<br />\r\n<b>Features</b><br />\r\nSafety reflective strips on the shoulders straps and bear pattern reflective strips on the side pockets to preventing from cars at night, or on foggy days, on rainy days.<br />\r\nWith chest strap and waist strap for relieving shoulders burden.<br />\r\n3D comfortable ergonomic relieve burden and heat dissipation system.<br />\r\nZipper around unfold design for easy to use and clean.<br />\r\n<br />\r\n<b>Highlight</b><br />\r\nSpine pressureless design, effectively avoid school bag hitting spine.<br />\r\nBreathable design, larger pores make the free air circulation.<br />\r\nWhole layers are breathable foam pad.<br />\r\nLayer 1 breathable mesh system.<br />\r\nLayer 2 widening delivery system.<br />\r\nLayer 3 decompression seismic-proof system.</span><br />\r\n&nbsp;',NULL,NULL,NULL,NULL,NULL,'Size and Weight','','','Size: 30 x 16 x 36 cm / 11.8 x 6.3 x 14.1 inch<br />\r\nWeight: 0.9kg','',''),(71,71,'<ul>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">Delune kids school backpack - Exclusive Designer Brand</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">Comfortable cloth and Exquisite workmanship - 600D high-density nylon and Jacquard material,lightweight,durable and waterproof.The schoolbag is made into a whole, and the superior production technology is used.</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">Beautiful print patterns - As you can see in the pictures,so cute and attractive,your kids will definitely love it,why not give them a surprise?</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">Safety Reflector - In view of the safety of children, we add 6 reflective strips on the schoolbag,just like the traffic police, which can effectively remind the vehicle.There is no reflective strip on the ordinary schoolbag,because it increases the cost.</span></li>\r\n	<li><span style=\"font-family:微软雅黑,arial;\">Refund guarantee - We accept unconditional refund,even after a year.Remember our brand:Delune.Click into our shop,more unique KIDS SCHOOL BACKPACK for you to choose.</span></li>\r\n</ul>',NULL,NULL,NULL,NULL,NULL,'Size and Weight','','','<span sty